description:
CLUTCH
Zilker Park, Austin City Limits Festival
Austin, Texas
2009-10-04

Captured thru WebcamMax from http://aclfestival.com/2009_files/webcast.html

Capture Specs:
NTSC drop frame (29.97 fps)
MPEG file
24 bits, 720 x 480, 29.97 fps
Upper Field First
(DVD-NTSC),  4:3
Video data rate: Variable (Max.  9000 kbps) 
